// Base64 PDF string (example, replace with your own base64 string)
const base64PDF = 'data:application/pdf;base64, ';

// Set up PDF.js
pdfjsLib.GlobalWorkerOptions.workerSrc = 'https://cdnjs.cloudflare.com/ajax/libs/pdf.js/2.10.377/pdf.worker.min.js';

// Decode the base64 PDF and render it on a canvas
const loadingTask = pdfjsLib.getDocument(base64PDF);
loadingTask.promise.then(function (pdf) {
    // Get the first page of the PDF
    pdf.getPage(1).then(function (page) {
        // Adjust the scale based on the window width (responsive scaling)
        const scale = window.innerWidth / page.getViewport({ scale: 1 }).width;
        const viewport = page.getViewport({ scale: scale });

        // Prepare the canvas and context
        const canvas = document.getElementById('pdf-canvas');
        const context = canvas.getContext('2d');
        
        // Set canvas size based on PDF viewport
        canvas.height = viewport.height;
        canvas.width = viewport.width;

        // Render the page on the canvas
        const renderContext = {
            canvasContext: context,
            viewport: viewport
        };
        page.render(renderContext);
    });
}).catch(function (error) {
    console.error('Error: ' + error);
});